import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import 'react-confirm-alert/src/react-confirm-alert.css';
import Stars from 'react-stars';
import { render } from 'react-dom';



class Reseña extends Component {
    constructor(props) {
        super(props)
        this.state = {
            //idLibro: this.props.match.params,
            calificacion: null,
            titulo: '',
            cuerpo: '',
        }

    }

    componentDidMount = () => {


    }

    onSubmit = () => {
        alert("Boton Funcando");
    }
    onInputChange = () => {

    }


    render() {
        const secondExample = {
            size: 50,
            count: 10,
            char: '',
            color1: '#ff9900',
            color2: '#6599ff',
            onChange: newValue => {
              console.log(`Example 2: new value is ${newValue}`)
            }
          }

        return (
            <div className="container-reseña">
                <div className="cardReseña col-md-6 offset-md-3 text-light bg-dark ">
                    <h4 className="card-header">Reseña para el libro: </h4>
                    <br></br>
                    <Stars {...secondExample} />



                    <form onSubmit={this.onSubmit} >

                        <div className="form-group">
                            <input
                                className="form-control"
                                id="titulo"
                                name="titulo"
                                onChange={this.onInputChange}
                                value={this.state.titulo}
                                placeholder="Título"
                                required>
                            </input>
                        </div>

                        <div className="form-group">
                            <textarea className="form-control"
                                id="cuerpo"
                                rows="3"
                                name="descripcion"
                                onChange={this.onInputChange}
                                value={this.state.cuerpo}
                                placeholder="Descripción"
                                required >
                            </textarea>
                        </div>

                        <div className="form-group">
                            <button type="submit" className="btn  btn-outline-danger itemBoton float-right">
                                Agregar reseña
                            </button>
                        </div>


                    </form>






                </div>
            </div>

        )
    }
}

export default Reseña;
